{{place|Florissant, Colorado}}
{{dated|1905-08-02|Aug. 2}}

	Went up track to RR cut E of town. River terrace in Lake beds there dissected by numerous gullies cut from top of mesa to base. Bright clear comfortable morning. Heard {{taxon|Colaptes auratus|flickers}} calling and {{taxon|Euphagus cyanocephalus|Brewer’s blackbirds}} singing as I worked. 

	Station 4. RR out just around point E. of Florissant. Leaves plentiful in a narrow stratum half way to top of cut, but few good specimens comparatively. I cut a diagonal furrow from the top of the cliff well down into the talus and found leaf bearing zones an inch or two in thickness alternating with barren zones of greater thickness. The fossiliferous zones were somewhat persistent, so far a

