 ago, found {{taxon| Trichoptera|caddis}} larva. Also found {{taxon| Lymnaea|Limnaea}} similar to those from Meeker, in great abundance, but only on the delta. Found a few dead shells further down the lake shore but none alive there. In the mouth of {{place|Twin Creek, Colorado|Twin Creek}} found a few {{taxon| Physa|Physa}}, smooth like {{taxon|Physella_acuta|P. integra}}, lying on the gravel, very hard to see. The {{taxon| Lymnaea|Limnaea}} were on the muddy bottom of the delta, nearly all adult, but smaller specimens, probably young of same

