At outlet of the lake, in a seepage pool just below the dam, were great numbers of {{taxon|Limnaea}}, alive, mingled with dead shells of a large {{taxon|Physa}}, but I could find none of the live Physas. The lake is formed by a dam thrown across the {{place|South Platte River}} shortly below the mouth of the stream which runs past Florissant. At the upper end are forming just such beds of fine mud as compose some portion of the Florissant  lake beds. The beds were very much cracked, many of the cracks being an inch or two wide an

{{dated|1905-08-29|'''Aug. 29, 1905'''}}

	Finished packing and loaded wagon in evening-last evening - putting tents over load to keep it dry. The load is a heavy one for two horses over a bad road. This morning opens bright and warm. Saw a {{taxon|Sayornis phoebe|phoebe}} in back yard before starting. 
	H. F. Watts, F. G. Henderson, Harvey R. Markman, Sievert Rohwer and I started by narrow gauge C & N at 9:35 for Silver Lake Siding, the wagon having gone early – Al Anderson’s wagon and good team. Train consisted of four cars to Sunset, then 2 cars to Silver Lake Siding which we reached at 11:45 p.m. (sic), 15 minutes late. At((e)) lunch at the brook NE of the siding and collected a few {{taxon|Pisidium|Pisidium abditum}} (No.1) in the bro

