n S. Dodds, Harvey C. Markman, Harry Clatworthy and I left {{place|Boulder, Colorado|Boulder}} in a camp wagon at 8:50, two riding in front and two behind. Broke a spring when about two miles north of town. Cut a block, blocked it up and went on, stopping to collect but little except a species of flax which I had not seen before, and some {{taxon|Pupa}}, {{taxon|Vallonia}} etc. at {{place|Six Mile Creek}}. Some of us walked considerable of the time. Reached {{place|Left Hand Creek}} at 12:10 and dined at 1:30, and were on the road again at 2:07.

