Starting in for a warm day, but at times cloudy. A slight breeze. We are camped on an island in a {{taxon|Populus|cottonwood}} grove. Has been cloudy and sultry this afternoon. We wrote postals and letters and Dodds went to town to mail them. I did not get through arranging, labelling, wrapping, and boxing {{taxon|mollusca}} and fossils collected yesterday and ay before until six o’clock, when we had stewed chicken and dumplings prepared by Harry. Harry is fishing and catching chubs etc. I have s

 got off the island at 10 p.m. (sic). Then Dodds 

