cement, flaking off horizontally in large scales practically the size of the concretions. The sandstone is quite soft, easily excavated with a knife. The {{taxon|Ostrea}} were well preserved, though thin, and valves were easily freed from sand on both sides with the knife. The other fossils were friable, the shell crumbling, leaving only casts. Some of the {{taxon|Mactra}} are very fine. The lower part of the exposure consists of alternating strata of thin bedded clay shales and sandstones, with lime-

